import React from 'react';
import { Route } from 'react-router-dom';
import {RentContainer} from '../../elements/Container';
import VentaCards from '../../layout/VentaCards';
import Catalogo from '../items/Catalogo';

const Venta = ({className}) => {
    return (
        <>
        <RentContainer className={className}>                     

              <Route exact path={`/venta/`} component={VentaCards}/>
              <Route 
                exact path={`/venta/:catalogo`} 

                render={(props) => (
                    <Catalogo {...props} salePrice={true} />
                  )}
                />

        </RentContainer> 
        </>
    );
};

export default Venta;
